import React from 'react';
import personImage from '../src/assets/avatar.png';
import { AiFillTwitterCircle, AiFillLinkedin, AiFillYoutube } from "react-icons/ai";

const Header = () => {
  return (
    <header className="text-black text-center">
      <div className="container">
        <div className="row">
          {/* Left side - Picture of a person in a circle */}
          <div className="col-lg-3">
            <div className="rounded-circle overflow-hidden mx-auto mb-3" style={{ width: '150px', height: '150px' }}>
              <img src={personImage} alt="Person" className="img-fluid" />
            </div>
          </div>

          {/* Right side - Two lines of typography */}
          <div className="col-lg-9">
            <h1>Izhar Ali</h1>
            <h2>Jr. DevOps Engineer and Designer</h2>
            <p>
              Freelancer providing services for programming and design content
              needs. Join me down below and let's get cracking!
            </p>
            <div className="text-5xl flex justify-center gap-16 py-3 text-gray-600 dark:text-gray-400">
              <AiFillTwitterCircle />
              <AiFillLinkedin />
              <AiFillYoutube />
            </div>
          </div>
        </div>
      </div>

      {/* Two buttons at the bottom */}
      <div className="text-center">
        <button className="btn btn-outline-dark me-3">Button 1</button>
        <button className="btn btn-outline-dark">Button 2</button>
      </div>
    </header>
  );
};

export default Header;
